import "./nav.module.css";
import Link from "next/link";

export const Nav = () => {
  return (
    <>
      <div>This is my Nav</div>
      <div
        style={{
          display: "flex",
          flexDirection: "row",
          width: "300px",
          justifyContent: "space-around",
          height: "80px",
          background: "aquamarine",
          alignItems: "center"
        }}
      >
        <Link href="/">
          <a>Home</a>
        </Link>
        <Link href="/about">
          <a>About</a>
        </Link>
        <Link href="/contact">
          <a>Contact</a>
        </Link>
      </div>
    </>
  );
};
